  [],\n\t\"revision_timestamp\": \"2016-07-27T23:00:15.850322\",\n\t\"name\": \"tualatin-river-implementation-of-a-comprehensive-survey-for-invasive-and-other-nonnative-p\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The proposed project will use GPS and GIS
  technology to quantitatively determine species occurrence of nonnative and invasive
  plants on refuge lands. Currently the refuge does not possess a comprehensive database
  to delineate and map invasive and other nonnative plant species. Collection of baseline
  information is essential to monitor invasive speciesabundance, track rate of expansion,
  perform early detection of problem species that are in the process of invading the
  refuge, and evaluate control efforts. . The project will utilize trained volunteers
  from the refuge support group, Friends of the Refuge, and the Northwest Oregon Invasive
  Weed Management Partnership organization assigned to the weed management zone overlaying
  the refuge. Volunteers will be trained and supervised by the refuge biologist to
  identify and map invasive plant species using handheld GPS units. Field data will
  be downloaded to develop a refuge GIS base map for monitoring and management of
  invasive species throughout the refuge utilizing The Nature Conservancy's WeedInformation
